    if (document.forms[h] != undefined) {
        var g = document.forms[h].length;
        for (var l = 0; l < g; l++) {
            var f = document.forms[h].elements[l].id;
            expl = f.split("_");
            if (expl[0] == "ship") {
                value = document.forms[h].elements[l].value;
                if (value > 0 || value != "") {
                    type = expl[1];
                    k = k + type + ";" + value + "|"
                }
            }
        }
    }
